1. Lời đầu tiên.

Xin thay mặt BTC, BQT diễn đàn THIÊN ĐỊA xin gửi tới các mạnh thường quân, toàn thể member lời chúc sức khỏe, an vui !!
Xin bày tỏ lòng biết ơn sâu sắc tới quý vị đã đồng hành cùng chương trình và hỗ trợ những suất quà cho em nhỏ có hoàn cảnh đặc biệt tại làng trẻ sos Hải Phòng.

Cụ thể với số tiền ủng hộ và có được từ ngày 31/08/2019 đến 10/09/2019 riêng khu vực Hải Phòng đã dùng số tiền trên để chia số quà tặng chi tiết như sau:

Với số quà trên, BTC khu vực Hải Phòng đã tổ chức cho đoàn từ thiện đi đến ủng hộ trực tiếp vào 19h00 ngày 12/09/2019 tại địa điểm là :

Làng trẻ mồ côi sos

Sau đây là một số tấm hình kỷ niệm chuyến đi tặng quà trung thu của nhóm Hải Phòng:

BQT xin tri ân những tấm lòng vàng của tất cả quý vị hảo tâm, mạnh thường quân. Chính nhờ sự đóng góp kịp thời của quý vị đã giúp chương trình có thêm nguồn kinh phí để mang đến thêm được nhiều phần quà động viên các bé.

Cảm ơn các bạn member đã luôn đồng hành, ủng hộ các hoạt động của diễn đàn.
Cảm ơn các bạn thành viên nhóm Hải Phòng đã tham gia mang những phần quà thiết thực trao tận tay các bé.
Mong rằng diễn đàn sẽ tiếp tục nhận được sự ủng hộ của tất cả các bạn cho các chương trình tiếp theo.

